import React from 'react';
import styled from 'styled-components';
import {backgroundColor2,fontSize2} from '../Shared/Styles';

export default styled.select`
${backgroundColor2}
${fontSize2}
color: white;
border: 1px solid;
margin: 5px;
height: 25px;
float: right;
`;
